import React from "react";

const Navbar = () => {
    return (
        <nav className="navbar navbar-dark bg-dark mb-4">
            <span className="navbar-brand mb-5 mx-auto"><h1><strong>E-Commerce</strong></h1></span>
            <button className="btn btn-light mt-5"><i className="fas fa-shopping-cart"></i></button>
        </nav>
    );
};

export default Navbar;
